import React, {useState} from "react"; 
import Maze from './Maze';
import Control_Button from './Control_Button';

function App() {

  const buttonContainer = Control_Button();
  const [mazeMatrix, updateMap] = useState([[]]);

  // Create the image element
  const image = document.createElement('img');
  image.src = ''; // Replace with the actual path to your image

// Add the image to the container
  const imageContainer = document.getElementById('imageContainer');
  imageContainer.appendChild(image);


  React.useEffect(() => { ///See CORS
    fetch("http://localhost:3001/mazeMatrix/") 
        .then((res) => res.json())
        .then((data) => updateMap(data.mazeMatrix)) 
        .catch((err) => alert(err)
    );
  }, [updateMap]);

  const handleClick = (updateMethod) => { 
    fetch("http://localhost:3001/mazeMatrix/")
      .then((res) => res.json())
      .then((data) => updateMethod(data.mazeMatrix)) 
      .catch((err) => alert(err)
    ); 
  }
  return (
    <div className="App">
      <h1 style={{ fontSize: '36px' }}>EBB-Imperial   Maze</h1>
      <Maze td = {mazeMatrix}/>
      <button onClick={() => handleClick(updateMap)}>Randomize Maze</button>
      <div id="buttonContainer"></div>
      {/* <div id="pictureContainer"></div> */}
    </div> );
}
export default App;
